var cat_64 = 'data:image/jpeg;base64,';

function dataURItoBlob(dataURI) {
    var binary = atob(dataURI.split(',')[1]);
    var array = [];
    for(var i = 0; i < binary.length; i++) {
        array.push(binary.charCodeAt(i));
    }
    return new Blob([new Uint8Array(array)], {type: 'image/jpeg'});
}

var blob = dataURItoBlob(cat_64);
var fd = new FormData();

document.forms[0].removeChild(document.forms[0].getElementsByClassName('file')[0]);
fd = new FormData(document.forms[0]);
fd.append("file", blob, "cat1.jpg");
fd.append("go", "add image");
console.log("jquery not available");
oReq = new XMLHttpRequest();
oReq.open("POST", document.forms[0].action, true);
oReq.setRequestHeader("Accept",'text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8');
oReq.setRequestHeader("Cache-Control",'max-age=0');
oReq.onload = function(oEvent){
    if(oReq.status === 302 || oReq.status === 301 || oReq.status === 200){
        window.location.reload();
    }
};
oReq.send(fd);
